import React, { useEffect, useState } from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';




const PastTrainingTable = () => {

  const [finishedExercises, setFinishedExercises] = useState([]);

  useEffect(() => {
    fetch('https://training-app-d460e.firebaseio.com/exercises')
    .then(result => {
      return JSON.parse(result);
    })
    .then(res => {
      setFinishedExercises(res);
      console.log(finishedExercises)
    })
    .catch(err => console.log(err))
  }, [])

    return (
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Exercise</TableCell>
                <TableCell align="right">Duration </TableCell>
                <TableCell align="right">Date </TableCell>
                <TableCell align="right"> Calories </TableCell>
                <TableCell align="right"> Status</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {finishedExercises.map((row) => (
                <TableRow key={row.name}>
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell align="right">{row.duration}</TableCell>
                  <TableCell align="right">{row.date}</TableCell>
                  <TableCell align="right">{row.calories}</TableCell>
                  <TableCell align="right">{row.status}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      );

}

export default PastTrainingTable;
